/**
* Fetching From id or something
* Returns Object 
* {
*   Error: boolean  
* }
*/
const Fetcher = (id) => {
    return new Promise((resolve) =>{
        fetch(`http://localhost:3001/contents/${id}`)
        .then(res=>res.json()
            .then(data=>{
            resolve({
                Errror:false,
                data:data.contents
            })
        }))
        resolve({
            Error:true,
            data:null
        })
        })
}

export default Fetcher
